import React from 'react';
import '../css/Servicios.css'

function Servicios() {
  return (
    <div>
      <h2>Servicios</h2>
      <p>Aquí puedes agregar información sobre los servicios que ofrece la empresa.</p>
      <img src="ruta-a-imagen.jpg" alt="Servicios" />
    </div>
  );
}

export default Servicios;
